Friend Request System - Express, MongoDB, EJS<p>I want to create a social network thus allowing users to send and interact with frind requests. As of now I have created the register, log-in and &quot;search for other users function&quot;.</p>
<p>When I find and select another user, I display their user-info and have created a &quot;Add friend&quot; button.</p>
<p>Can anyone help me in a direction of the creation of the &quot;Add friend&quot; option? I have looked around for some time now, and not been able to find the correct solution. Below I have attached my UserSchema and route for finding users:</p>
<pre><code>//User Schema
const UserSchema = new mongoose.Schema({
    firstName: {
        type: String,
        required: true
    },
    lastName: {
        type: String,
        required: true
    },
    password: {
        type: String,
        required: true
    },
},{ collection: 'Users' });




//Get single user based on ID
router.get('/user/get:id', ensureAuthenticated, function (req, res) {
    MongoClient.connect(DBUri,{useUnifiedTopology: true }, function (err, db) {
        let dbo = db.db(DBName);
        const query = {_id: objectId(req.params.id)}
        dbo.collection(&quot;Users&quot;).find(query).toArray(function(err, resultTasks) {
            if (err) throw err;
            res.render('../View/findFriend', {
                resultTasks: resultTasks
            });
            db.close();
        });
    });
});


</code></pre>

